export const treeData = {
  name: "Top Level",
  children: [
    {
      name: "Level 2: A",
      children: [
        { name: "Son of A", tooltip: "react app to render table. Include" },
        {
          name: "Daughter of A",
          tooltip: "react app to render table. Included TDD and storybook"
        }
      ],
      tooltip: "react app to render table. Included TDD and storybook"
    },
    { name: "Level 2: B", tooltip: "dfghjkl;" }
  ],
  tooltip: "react app to render table. Included TDD and storybook"
};
